import io
import zlib
import base64

def revbyte(b):
    b = ((b & 0x0F) << 4) | ((b & 0xF0) >> 4)
    b = ((b & 0x33) << 2) | ((b & 0xCC) >> 2)
    return ((b & 0x55) << 1) | ((b & 0xAA) >> 1)

def readbool(b):
    return bool.from_bytes(b.read(1), 'big')

def readb(b):
    return int.from_bytes(b.read(1), 'big')
def reads(b):
    return int.from_bytes(b.read(2), 'big')
def readi(b):
    return int.from_bytes(b.read(4), 'big')
def readl(b):
    return int.from_bytes(b.read(8), 'big')

def readutf(b):
    return b.read(reads(b)).decode()

def readobj(b):
    type = readb(b)
    match type:
        case 0:
            return None
        case 2:
            return readl(b)
        case 4:
            return readutf(b) if readb(b) else None
        case 7:
            return [readi(b), readi(b)]
        case 10:
            return readbool(b)
        case 21:
            return [readi(b) for _ in range(reads(b))]
        case 22:
            return [readobj(b) for _ in range(readi(b))]
        case _:
            raise ValueError("object type " + str(type) + " not implemented:\n" + str(b.read(100)))

b = bytes.fromhex(input("Enter bytes (hex): "))
b += b'\x00' * (65536 - len(b))

msch = ''
msch = base64.b64decode(msch)

head = b'msch\x01'
msch = zlib.decompress(msch[5:])

body = bytearray(msch)

msch = io.BytesIO(msch)

labels = msch.read(48)

blocks = []

for i in range(readb(msch)):
    blocks.append(readutf(msch))

index = 0

for i in range(readi(msch)):
    block = readb(msch)
    pos = readi(msch)

    if blocks[block] == 'eso-memory' and pos & 0xFF != 149:
        bank = int(index > 127)
        column = (index // 16) % 8
        row = 15 - index % 16
        flipped = (row + column) % 2 == 1

        address = (column + row * 8) * 2 + bank
        offset = msch.tell() + 8
        for i in range(256):
            if flipped:
                body[offset + revbyte(i) * 4 + 3] = b[address + i * 256]
            else:
                body[offset + i * 4 + 3] = revbyte(b[address + i * 256])

        index += 1
    
    if blocks[block] == 'eso-label':
        print(body[msch.tell():msch.tell()+100])

    config = readobj(msch)
    rotation = readb(msch)

with open('ESO_M16.msch', 'wb') as o:
    o.write(head + zlib.compress(body))